(function(){if(!window.ABLincoln){return}var link=document.querySelector(".js-topnav-create");if(!link){return}link.addEventListener("mouseenter",function(){var loversTest=window.ABLincoln.getTest("TopNav.RemoveVideoLovers");if(!loversTest){return}if(loversTest.get("target","control")==="control"){return}var listElement=document.querySelector("#topnav_create");if(listElement.children.length<5){return}var loversItemElement=listElement.children[3];listElement.removeChild(loversItemElement)})})();